import React, { Component } from "react";
 
class Student extends Component {
  render() {
    return (
      <div>
        <h1>Welcome to Courses</h1>
        <h3> List of Courses </h3>
        <li><NavLink exact to="/Student-DataScience"> <a href="http://forum.kirupa.com"> Data Science </a></NavLink> </li>
        <li><NavLink exact to="/Student-MachineLearning"> <a href="http://forum.kirupa.com"> Machine Learning </a></NavLink> </li>
        <li><NavLink exact to="/Student-BigData"> <a href="http://forum.kirupa.com"> Big Data </a></NavLink> </li>
      
        <div className="content">
            <Route exact path="/" component={Student}/>
            <Route path="/Student-DataScience" component={DataScience}/>
            <Route path="/Student-MachineLearning" component={MachineLearning}/>
            <Route path="/Student-BigData" component={BigData}/>
        </div>
      </div>
    );
  }
}
 
export default Student;
